  true,\n\t\"url\": null,\n\t\"notes\": \"<p>CMS implemented a Prior Authorization
  process for scooters and power wheelchairs for people with Fee-For-Service Medicare
  who reside in seven states with high populations of fraud- and error-prone providers
  (CA, IL, MI, NY, NC, FL and TX). In addition to other benefits, this demonstration
  will help ensure that a beneficiarys medical condition warrants their medical equipment
  under existing coverage guidelines. Moreover, the program will assist in preserving
  a Medicare beneficiarys ability to receive quality products from accredited suppliers.</p>n\",\n\t\"license_title\":
